import BaseLayout from '../components/layouts/BaseLayout';
import React, { Component } from 'react'

export default class Heritage extends Component {
    render() {
        return (
            <BaseLayout>
                <h1> Im a heritage page</h1>
            </BaseLayout>
        )
    }
}
